import styled from "styled-components"
import COLOR from "./COLOR";

const ProgressBar = styled.div`
    width: 62rem;
    height: 3.2rem;
    border-radius: 999rem;
    background-color: ${COLOR.GSF0};
    box-shadow: inset 0px 3px 7px rgba(0, 0, 0, 0.2);
    position: relative;
`;

const ProgressTitle = styled.div`
    width: 12rem;
    height: 3.2rem;
    border-radius: 999rem;
    background-color: #7986cc;
    margin-right: 1.5rem;
`;

const ProgressBox = styled.div`
    width: 75.5rem;
    height: 3.2rem;
    display: flex;
    flex-direction: row;
`;
const ProgressGraph = styled.div`
width: 10rem;
height: 3.2rem;
position: absolute;
top: 0;
left: 0;
border-radius: 999rem;
background-color: ${COLOR.Primary};
`;
function ProgressGraphCom () {
    return (
        <ProgressGraph />
    )
}
function ProgressBarContainer () {
    return (
        <ProgressBox>
            <ProgressTitle />
            <ProgressBar>
                <ProgressGraph />
            </ProgressBar>
        </ProgressBox>
    )
}

export default ProgressBarContainer;
